    <p class=Body><span lang=EN-US style='font-size:38.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-ansi-language:EN-US'>PREFACE:</span><span style='font-size:38.0pt;
    font-family:"Bodoni SvtyTwo SC ITC TT-Book";mso-fareast-font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-bidi-font-family:"Bodoni SvtyTwo SC ITC TT-Book"'><o:p></o:p></span></p>
    <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-ansi-language:EN-US'>I have often enjoyed the company, character, and
    song of birds. I like some species more than others, to be quite precise
    like I like Whiskered Terns better than Spotted Doves but I like most birds
    with a general competence of affection. Birds are the light of my life and
    I much appreciate photographing them, drawing and painting them and writing
    about them. I hope many other people will appreciate this book and take up
    the hobby of BIRDWATCHING.</span><span style='font-size:14.0pt;font-family:
    "Bodoni SvtyTwo SC ITC TT-Book";mso-fareast-font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-bidi-font-family:"Bodoni SvtyTwo SC ITC TT-Book"'><o:p></o:p></span></p>

    mso-fareast-font-family:"Bodoni SvtyTwo SC ITC TT-Book";mso-bidi-font-family:
    "Bodoni SvtyTwo SC ITC TT-Book"'><o:p>&nbsp;</o:p></span></p>

    <p class=Body><span lang=EN-US style='font-size:36.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-ansi-language:EN-US'>FOREWORD:</span><span style='font-size:36.0pt;
    font-family:"Bodoni SvtyTwo SC ITC TT-Book";mso-fareast-font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-bidi-font-family:"Bodoni SvtyTwo SC ITC TT-Book"'><o:p></o:p></span></p>
    <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-ansi-language:EN-US'>This is a book for all people to enjoy and read.
    It contains some of my favourite photos and many photos of birds, most of
    them with the camera they were taken with and all minor details. I enjoy
    photographing birds, and I hope I will pass the passion on to you so that
    everyone who reads this book has a fond imagination of the beauty,
    extraordinary character and many other things about, BIRDS.</span><span
    style='font-size:14.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-fareast-font-family:"Bodoni SvtyTwo SC ITC TT-Book";mso-bidi-font-family:

    <p class=Body><span lang=EN-US style='font-size:40.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-ansi-language:EN-US'>INTRODUCTION:</span><span style='font-size:40.0pt;
    font-family:"Bodoni SvtyTwo SC ITC TT-Book";mso-fareast-font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-bidi-font-family:"Bodoni SvtyTwo SC ITC TT-Book"'><o:p></o:p></span></p>
    <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-ansi-language:EN-US'>Birds are the highlight of my life. I have been in
    many experiences associated with birds, and one of the most popular
    highlights are birds fishing. Whether its a heron striking its spear-like
    beak into the water and spearing a fish or a kingfisher diving head first
    into the water, fishing seems to be one of the most attractive spectacles
    to me. I have seen Whiskered Terns plucking fish out of the sea with
    scarcely a ripple and bulky pacific gulls<span style='mso-spacerun:yes'> 
    </span>diving into the water, making a huge splash and coming out empty
    handed (or beaked) and Oystercatchers jabbing at small molluscs,
    crustaceans and other arthropods, Eastern Reef Egrets fishing, picking up
    little creatures here and there, White-bellied Sea Eagles pursuing seals to
    snatch a large salmon the seal caught, they all have the same type of
    excitement as I watch, breathless to experience the coming of the BIRD.</span><span
    style='font-size:14.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-fareast-font-family:"Bodoni SvtyTwo SC ITC TT-Book";mso-bidi-font-family:
    "Bodoni SvtyTwo SC ITC TT-Book"'><o:p></o:p></span></p>
    <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
    mso-ansi-language:EN-US'>Albert Kemp</span></p>
    </div>
    <![if !mso]></td>
   </tr>

     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
     mso-ansi-language:EN-US'>I am standing up high in a lighthouse in
     Anglesea, Vic. I have seen egret tracks, a legless lizard, a Yellow-tufted
     Honeyeater, a Spotted Pardalote, a Gang-gang Cockatoo and a New Holland
     Honeyeater in the past two days. I relish the peace of the morning with
     grace as I ascend up into the lighthouse above. Before I went up I saw two
     undetermined raptors circling the lighthouse and a whoosh of excitement
     fills my mind. I climb up the steps, have a bit of an arguement with my
     friend about if White-bellied Sea Eagles really nest on Eagle’s Nest Rock
     and he says they do and I say they don’t. Unfortunately, I am just at this
     moment missing out on the highlight of this story, right at this moment a
     Nankeen Kestrel is circling the lighthouse. So that’s what those raptors
     were (I only got proof when viewing the photos my Albert-understanding
     school teacher took) and at this moment, I unfortunately am not gaping in
     wonder at the pair of Nankeen Kestrels circling the monument but arguing
     about a subject as rash as “Do White-bellied Sea Eagles nest on Eagle’s
     Nest Rock?” Well I don’t really want to find out as I have missed out on
     this, but here’s something I lack. I’m not so sad on the fact that there
     at this moment a Nankeen Kestrel is next to the lighthouse but indeed, I
     only mentioned that I wanted the photo sent. So here’s what I lack. I only
     care about the photo, whether it’s a whopping good one or one that looks
     more like a horse but it just seems like a photo is all I require to be
     happy instead of experiencing the actual presence of the bird, the actual
     place, actual time, the wind in my face. I don’t know why because looking
     at an old photo is basically the same as looking at a bird so there doesn’t
     seem to be much difference.</span><span style='font-size:14.0pt;
     font-family:"Bodoni SvtyTwo SC ITC TT-Book";mso-fareast-font-family:"Bodoni SvtyTwo SC ITC TT-Book";
     mso-bidi-font-family:"Bodoni SvtyTwo SC ITC TT-Book"'><o:p></o:p></span></p>
     <p class=Body><span style='font-size:14.0pt;font-family:"Bodoni SvtyTwo SC ITC TT-Book";
     mso-fareast-font-family:"Bodoni SvtyTwo SC ITC TT-Book";mso-bidi-font-family:
     "Bodoni SvtyTwo SC ITC TT-Book"'><o:p>&nbsp;</o:p></span></p>
     <p class=Body><i><span lang=EN-US style='font-size:13.0pt;mso-ansi-language:
     EN-US'>Image above: A White-browed Scrubwren, one of Australia’s native
     wrens.</span></i><i><span style='font-size:13.0pt'><o:p></o:p></span></i></p>
     <p class=Body><span style='font-size:13.0pt'><o:p>&nbsp;</o:p></span></p>

     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>Out of
     the ever-changing list of birds that I like, Honeyeaters can score a
     pretty big goal. This is a New Holland Honeyeater perching on a bush in
     the long strip of coastal vegetation at Sandridge Beach. I have seen many
     things at Sandridge – Superb Fairy-wrens to Pacific Gulls but the hardest
     bird that I have ever taken is the New Holland Honeyeater. I am excited
     when I photograph any bird but for honeyeaters, it seems to go a step
     further. I like New Holland Honeyeaters for the difficulty of photographing
     them as they are quite shy and I’m not very good at remember<span
     style='mso-spacerun:yes'>   </span>ing to bring my camera but just the
     satisfaction of taking a photo of a honeyeater makes me feel assured, I
     have captured one of the birds that I </span><span style='font-size:14.0pt;
     font-family:"Times New Roman",serif;mso-fareast-font-family:"Times New Roman"'><o:p></o:p></span></p>

     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>find
     hardest to photograph. </span><span style='font-size:14.0pt;font-family:

     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>Willie
     Wagtails might be one of my favourite birds due to their character. I like
     how they seem to be always curious about what’s going on in the world. I
     chose this photograph of one because of the background of white flowers,
     it makes you get a sense of an interesting image with not only the
     background blurred but a sort of balanced effect with the white standing
     out, it seems to put the bird out of the focus, though I like that, I had
     to crop it to make it fit so it doesn’t look quite like what I expected
     but I like how it looks like a curious bird surveying the gorgeous view (a
     few white flowers) but it makes me think of how big this world is for
     birds like Willie Wagtails. Although my favourite birds are small birds
     like </span><span style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-fareast-font-family:"Times New Roman"'><o:p></o:p></span></p>
     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>fairy-wrens,Willie
     Wagtails have a precious characteristic of<span style='mso-spacerun:yes'> 
     </span>being cheeky, which although is found in most birds seems to be
     exaggerate </span><span style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-fareast-font-family:"Times New Roman"'><o:p></o:p></span></p>
     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>the
     quality, I have to admit that Superb Fairy-wrens are quite hard to capture
     but Willie Wagtails have a luxurious character that can’t be missed.</span><span
     style='font-size:14.0pt;font-family:"Times New Roman",serif;mso-fareast-font-family:
     "Times New Roman"'><o:p></o:p></span></p>
     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>WillWillie<span
     style='mso-spacerun:yes'>  </span>willie and honeyeaters, Willie Wagtails
     aren’t gonna be too low on the list. </span><span style='font-size:14.0pt;
     font-family:"Times New Roman",serif;mso-fareast-font-family:"Times New Roman";

    <p class=Body><span lang=EN-US style='font-size:25.0pt;font-family:"Times New Roman",serif;
    mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>SUPERB
    FAIRY-WREN</span><span style='font-size:25.0pt;font-family:"Times New Roman",serif;
    mso-fareast-font-family:"Times New Roman"'><o:p></o:p></span></p>
    <p class=Body><span lang=EN-US style='font-size:15.0pt;font-family:"Times New Roman",serif;
    mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>The Superb
    fairy-wren is a common fairy wren inhabiting much of Australia. The birds
    living in different locations vary in colour, the inland ones have paler
    head plumes (left) and the ones living in coastal areas have darker ones
    (above). They are very attractive little birds, in my opinion more
    attractive than the almost all blue Splendid Fairy-wren because they don’t
    seem to overdo it in colour. I often see them hopping around bushes,
    darting in and out, they are very hard to capture. Another thing I enjoy
    watching is the movement above, the bird has one leg up in the air and is
    wagging his tail, somewhat expressing a cheeky character. I’m still waiting
    for one of them to </span><span style='font-size:15.0pt;font-family:"Times New Roman",serif;
    mso-fareast-font-family:"Times New Roman"'><o:p></o:p></span></p>
    <p class=Body><span lang=EN-US style='font-size:15.0pt;font-family:"Times New Roman",serif;
    mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>lose their
    balance.</span></p>
    </div>
    <![if !mso]></td>
   </tr>

     <td><![endif]>
     <div>
     <p class=Body><span lang=EN-US style='font-size:15.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>In the
     next few pages there are a few of my favourite photos of birds looking
     sly, birds reflected against the light but not silhouetted and birds that
     just seem like their trying to be naughty. I enjoy bird’s character
     because they always seem curious about what the world is. I prefer tough
     birds looking a bit funny or appearing to scream at things than the
     rainbow fat smiley birds that people call cute. It seems that birds have
     so many great characteristics that people don’t understand, birds have as
     complex brains as humans in some ways. If humans were basically robots
     saying only facts and never laughing I wouldn’t call them humans, humans
     have character and can think, exceeding the skills of any computer, no
     matter how intelligent they are.</span></p>
     </div>

    <tr>
     <td><![endif]>
     <div>
     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>I have
     always liked seabirds because of their size, elongated shape – chiefly
     Albatrosses have extremely long, thin wings and gulls seem to rejoice in
     their speed and soar in great hights. I like this photo especially because
     the smaller Silver Gull on he right looks sort of grumpy, like the
     characteristic here is like “I caught a fish,” said the Pacific Gull
     excitedly “Look, it’s a mighty big one!” “Yeah right, and you don’t share
     it with me,” bitterly “I wait loyally all this time and you… Also, I like
     how the Pacific Gull’s wings just fit into the picture, like it was made
     at the angle to just fit the wings in. I have many experiences of Pacific
     Gulls gliding over the ocean on their much praised wings and soaring in, </span><span
     style='font-size:14.0pt;font-family:"Times New Roman",serif;mso-fareast-font-family:
     "Times New Roman"'><o:p></o:p></span></p>
     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>surprised
     to find their old territory gone, people congregating in huge numbers on
     the once deserted shores, it makes me feel sad as I have always had some
     admiration in the seabirds of Australia.</span></p>
     </div>

     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>I have
     always liked this photo of a Nankeen Night-heron as it seems to have a sly
     look on it’s face like if these humans stay any longer it will plan for a
     trick like fill someone’s sock with wood lice or something. It looks sort
     of sly like it has a plan or is doing it, but it also looks a little like
     an old man who’s just having a break from caring for someone’s spoilt baby
     like “I’m having a break at last” (it did have a juvenile sleeping next to
     it on p1) </span></p>

     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>I take a
     fancy for photos that are silhouetted with a border of light circling the
     subject but even better, this photo the rosella has actually kept it’s
     colours. II like how in this photo even the cobwebs look like glittering
     jewels, they usually look like them when they have raindrops on them but
     in this photo even they have a pleasant golden colour. I also like how in
     this photo the Eastern Rosella has a slim and elongated appearance and how
     the mottled breast with red and yellowy green shows clearly in the photo.
     Even though I like the function of making the bird have a bright edge I
     still like having it completely silhouetted – it gives an artistic impression
     to the photo.</span></p>
     </div>

     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>As on the
     last page I was talking about silhouettes, this is a real one. There is no
     editing, no black and white function but the appearance to be taken by an
     old fashioned camera is entirely created by the sun. On this occasion the
     sun was extremely bright so it created a black and white silhouette. I
     like the photos with silhouettes, but I prefer them to be silhouetted with
     a golden background rather than a completely white one. Even </span><span
     style='font-size:14.0pt;font-family:"Times New Roman",serif;mso-fareast-font-family:
     "Times New Roman"'><o:p></o:p></span></p>
     <p class=Body><span lang=EN-US style='font-size:14.0pt;font-family:"Times New Roman",serif;
     mso-bidi-font-family:"Arial Unicode MS";mso-ansi-language:EN-US'>so, I
     like this photo because it brings you to see the detail in a bird’s
     plumage – just the outside but when looked at it creates a highly
     contrasted image of a bird’s feathers as they are black and white – when a
     photo is in colour people see colour but don’t notice the details of a
     bird’s body.</span></p>
     </div>
